import React from 'react';
import uuid from 'uuid';

const item=(props)=>{


const element= props.variables;

  return (

        <tr key={uuid()}>
          <th key={(element._id)} className="text-right">
            {(element.nombre)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.correo)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.canton)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.provincia)}
          </th>
          <th>
          <Button outline color="info">Edit</Button>
          <Button outline color="danger">Remove</Button>
          </th>
        </tr>


  )
};

export default item;
